import React, { Component } from "react";


class Card extends Component{
    constructor(props){
        super(props);
        console.log(this.props.movies)
    }
    render(){
        return (
            <div>
                <h2>{this.props.movies.title}</h2>
            </div>
        )
    }
}
export default Card;
